import React from 'react'
import "./Box.css"

const Box = ({box_value}) => {
    const box_style = box_value === "X" ? "box x" : "box o";
    return (
        <div className={box_style}>
            <button> {box_value} </button> 
        </div>
    )
}

export default Box;
